# given CNOT number, single qubit gate number, error list, time, lambda
# return new gate

def data(CNOT_numses, single_q_numses, errors, t, lam):
    N_list = [int(2.0 * lam * lam * t * t / error)+1 for error in errors]
    N_num = N_list
    for i in range(19):
        N_num = N_num + N_list
    N_numses = []
    for i in range(3):
        N_numses.append(N_num)
    gate_numses = []
    for i in range(len(CNOT_numses)):
        gate = [x + y for x, y in zip(CNOT_numses[i], single_q_numses[i])]
        gate = [x + y for x, y in zip(gate, N_numses[i])]
        gate_numses.append(gate)
    return gate_numses


